import { BrowserRouter, Switch, Route } from "react-router-dom";
import "./App.scss";
import Lobby from "./components/Lobby/Lobby";
import LandingPage from "./pages/LandingPage";

function App() {
	return (
		<BrowserRouter>
			<Switch>
				<Route></Route>
				<LandingPage />
				<Lobby />
			</Switch>
		</BrowserRouter>
	);
}

export default App;
